Convert query builder conditions to MongoDB operations including nested array of subdocuments<p>I am building an application in Angular 8 on the client side and NodeJS 12 with MongoDB 4 / Mongoose 5 on the server side. I have a query generated by the <a href="https://www.npmjs.com/package/angular2-query-builder" rel="nofollow noreferrer">Angular2 query builder</a> module. The Angular query builder object is sent to the server.</p>

<p>I have a server-side controller function that <a href="https://stackoverflow.com/questions/57099793/convert-json-query-conditions-to-mongodb-mongoose-operations">converts the Angular query object to MongoDB operations</a>. This is working perfectly for generating queries for top-level properties such as <code>RecordID</code> and <code>RecordType</code>. This is also working for building nested and/or conditions.</p>

<p>However, I need to also support querying an <strong>array of subdocuments</strong> (the "Items" array in the example schema).</p>

<p><strong>Schema</strong></p>

<p>Here is the example schema I am trying to query:</p>

<pre><code>{
  RecordID: 123,
  RecordType: "Item",
  Items: [
    {
      Title: "Example Title 1",
      Description: "A description 1"
    },
    {
      Title: "Example 2",
      Description: "A description 2"
    },
    {
      Title: "A title 3",
      Description: "A description 3"
    },
  ]
}
</code></pre>

<p><strong>Working example</strong> </p>

<p><em>Top-level properties only</em></p>

<p>Here's an example of the query builder output with and/or conditions on top-level properties only:</p>

<pre><code>{ "condition": "or", "rules": [ { "field": "RecordID", "operator": "=", "value": 1 }, { "condition": "and", "rules": [ { "field": "RecordType", "operator": "=", "value": "Item" } ] } ] }
</code></pre>

<p>Here's the query builder output after it has been converted to MongoDB operations on top-level properties only:</p>

<pre><code>{ '$expr': { '$or': [ { '$eq': [ '$RecordID', 1 ] }, { '$and': [ { '$eq': [ '$RecordType', 'Item' ] } ] } ] }}
</code></pre>

<p>that converts the angular query object to mongodb operators.</p>

<p>Here is the existing query conversion function that</p>

<pre><code>const conditions = { "and": "$and", "or": "$or" };
const operators = { "=": "$eq", "!=": "$ne", "&lt;": "$lt", "&lt;=": "$lte", "&gt;": "$gt", "&gt;=": "$gte" };

const mapRule = rule =&gt; ({
    [operators[rule.operator]]: [ "$"+rule.field, rule.value ]
});

const mapRuleSet = ruleSet =&gt; {
    return {
        [conditions[ruleSet.condition]]: ruleSet.rules.map(
            rule =&gt; rule.operator ? mapRule(rule) : mapRuleSet(rule)
        )
    }
};

let mongoDbQuery = { $expr: mapRuleSet(q) };
console.log(mongoDbQuery);
</code></pre>

<p><strong>Issue</strong></p>

<p>The function works for top-level properties only such as RecordID and RecordType, but I need to <strong>extend it to support the Items array of subdocuments</strong>.</p>

<p>Apparently, to query properties in nested arrays of subdocuments, the <code>$elemMatch</code> operator must be used, based on <a href="https://stackoverflow.com/questions/57258776/mongodb-expression-to-query-array-of-subdocuments">this related question</a>. However, in my case, the $expr is necessary to build the nested and/or conditions so I can't simply switch to <code>$elemMatch</code>.</p>

<p><strong>QUESTION</strong></p>

<p>How can I extend the query conversion function to also support $elemMatch to query arrays of subdocuments? Is there a way to get the $expr to work? </p>

<p><strong>UI query builder</strong></p>

<p>Here is the UI query builder with the nested "Items" array of subdocuments. In this example, the results should match RecordType equals "Item" AND Items.Title equals "Example Title 1" OR Items.Title contains "Example".</p>

<p><a href="https://i.stack.imgur.com/rhrqm.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/rhrqm.png" alt="Angular query builder with nested array of objects"></a></p>

<p>Here is the output generated by the UI query builder. Note: The <code>field</code> and <code>operator</code> property values are configurable.</p>

<pre><code>{"condition":"and","rules":[{"field":"RecordType","operator":"=","value":"Item"},{"condition":"or","rules":[{"field":"Items.Title","operator":"=","value":"Example Title 1"},{"field":"Items.Title","operator":"contains","value":"Example"}]}]}
</code></pre>

<p>UPDATE: I may have found a query format that works with the nested and/or conditions with the <code>$elemMatch</code> as well. I had to remove the <code>$expr</code> operator since <code>$elemMatch</code> does not work inside of expressions. I took inspiration from the <a href="https://stackoverflow.com/questions/44786973/use-or-with-elemmatch-and-condition-outside-of-array">answer to this similar question</a>.</p>

<p>This is the query that is working. The next step will be for me to figure out how to adjust the query builder conversion function to create the query.</p>

<pre><code>{
  "$and": [{
      "RecordType": {
        "$eq": "Item"
      }
    },
    {
      "$or": [{
          "RecordID": {
            "$eq": 1
          }
        },
        {
          "Items": {
            "$elemMatch": {
              "Title": { "$eq": "Example Title 1" }
            }
          }
        }
      ]
    }
  ]
}
</code></pre>

