<pre><code>{"condition":"and","rules":[{"field":"RecordType","operator":"=","value":"Item"},{"condition":"or","rules":[{"field":"Items.Title","operator":"=","value":"Example Title 1"},{"field":"Items.Title","operator":"contains","value":"Example"}]}]}
</code></pre>

<p>UPDATE: I may have found a query format that works with the nested and/or conditions with the <code>$elemMatch</code> as well. I had to remove the <code>$expr</code> operator since <code>$elemMatch</code> does not work inside of expressions. I took inspiration from the <a href="https://stackoverflow.com/questions/44786973/use-or-with-elemmatch-and-condition-outside-of-array">answer to this similar question</a>.</p>

<p>This is the query that is working. The next step will be for me to figure out how to adjust the query builder conversion function to create the query.</p>

<pre><code>{
