embedfield:
How to add elements to an array on a 'root' in Mongo<p>In mongo I am constantly collecting data as I execute queries and then use group to keep track of the attributes I need to maintain. In my case a patient record that has lots of data and then when I get medications I then have to group every attribute I need to keep. </p>

<p>Below is an example.</p>

<pre><code>{
        $group:{
            "_id":"$_id",
            "firstName":{$first:"$firstName"},
            "lastName":{$first:"$lastName"},
            "conditions":{$first:"$conditions"},
            "provider":{$first:"$provider"},
            "plans":{$first:"$plans"},
            "orgs":{$first:"$orgs"},
        }
    }
</code></pre>

<p>What I want I have been doing instead is:</p>

<pre><code>  { 
      $group: { _id: "$Id", results: { $first: '$$ROOT' } } ,
      $replaceRoot: { newRoot: '$results' } 
}
</code></pre>

<p>This seems excessive but the only way I could find to 'maintain' the complete patient information.</p>

<p>Is there a way to do this without having to do the replace?</p>

<p>The reason is I want to add medications to the patient record and while I can add it using the first method using :</p>

<pre><code>{
        $group:{
            "_id":"$_id",
            "firstName":{$first:"$firstName"},
            "lastName":{$first:"$lastName"},
            "conditions":{$first:"$conditions"},
            "provider":{$first:"$provider"},
            "plans":{$first:"$plans"},
            "orgs":{$first:"$orgs"},
            "medications":{
                $push:"$medications"
            }
        }
    }
</code></pre>

<p>I cannot do this:</p>

<pre><code>{ 
      $group: { _id: "$Id", 
          results: { $first: '$$ROOT' },
          "medications":{
                $push:"$medications"
           }
           ,
      $replaceRoot: { newRoot: '$results' } 
}
</code></pre>

<p>But this is not allowed add 'attributes' when doing a results on a root. </p>

<p>Any suggestions on do this? Perhaps a way to have the $group just copy all attributes verses naming each one?</p>

